const MassageScreen = () => {
  const contentOffset = useSharedValue(0);
  return (
    <View>
      <FlatList
        horizontal
        style={{
          height: height,
          //   width: width,
        }}
        contentContainerStyle={{
          alignItems: 'center',
          //   justifyContent: 'center',
          paddingLeft: 145,
        }}
        scrollEventThrottle={16}
        // pagingEnabled
        onScroll={e => {
          contentOffset.value = e.nativeEvent.contentOffset.x;
        }}
        data={data}
        keyExtractor={item => item.id + new Date().toDateString()}
        renderItem={({index, item}) => (
          <ModalItems index={index} item={item} contentOffset={contentOffset} />
        )}
      />
    </View>
  );
};

export default MassageScreen;

const styles = StyleSheet.create({});
